import { SendVote } from "../App";


function VoteBox(props) {
    var Choices = props.Choices;

    return(
        <div>
            <h1>Vote</h1>
            <div key = '0'>
            {Choices.map((Choice) => {
                return <div key = {Choice.Id}><p><button onClick={() => SendVote(Choice.Id)}>{Choice.text}</button></p></div>
            })}
            </div>
        </div>
        
    );
}

export default VoteBox;
